const initialState = '';

export const setWinningSquares = (s1, s2, s3) => ({
    type: 'SET_WINNING_SQUARES',
    s1, s2, s3
});

const winningSquaresReducer = (state = initialState, action) => {
    switch (action.type) {
        case 'SET_WINNING_SQUARES':
            const newState = state += 'ff';
            return newState;
        default:
            return state;
    }
};

export default winningSquaresReducer;
